import React from "react";
import { Link } from "react-router-dom";
import logo from './colour-logo-on-navy.png';

const MainNavBar = () => {
    return (
        <nav>
            <span>
                <Link to="/"><img src={logo} alt="Logo" /></Link>&nbsp;
                {/* <Link to="/profile">Contact</Link> */}
            </span>
        </nav>
    );
};

export default MainNavBar;
